import styles from './App.module.css';


//app is known as component
function App() {
  const users= [
    {name:"tlotlsio",age: 21},
    {name:"kagiso",age: 50},
  ];

  return (
    <div className={styles.App}>
      {users.map((user, key) => {
          return <div> {user.name} {user.age} </div>
      })}
    </div>
  );
};

export default App;
